import React from "react";
import * as Components from './Components';

function Login() {
    const [signIn] = React.useState(true);
     return(

        <Components.body>
            <Components.Container>

            <Components.SignInContainer signinIn={signIn}>
                 <Components.Form>
                 <Components.LogoIcon src="https://lh5.googleusercontent.com/proxy/DG7wQT5MyXoK68d6vCp5s2V7Lxm5_-mDz7j8Ym29tgxP9gY70qy4JoG4tcRYwIe72foKCfEF" alt="Logo" />
                     <Components.Title>INICIAR SESION</Components.Title>
                     <Components.Input type='email' placeholder='Email' />
                     <Components.Input type='password' placeholder='Password' />
                     <Components.Anchor href='#'></Components.Anchor>
                     <Components.Button>Ingresar</Components.Button>
                 </Components.Form>
            </Components.SignInContainer>
        </Components.Container>
        </Components.body>

     )
}

export default Login;
